import React from 'react'
import "./Proposal.css";

const Proposal = () => {
  return (
   <div className="headerproposal"><h1 >PROPOSALS</h1>
   <div className="Proposal">

      <h1>Set up an NFT Gallery Art in the Metaverse</h1>
    <p className="Proposaltext">Summary. Create the Freedom Tower virtual NFT gallery in the metaverse and make it accesible to anyone, anywhere, all for free.</p>
    <a href="#" className="btn btn-primary">
          Join
        </a>

   </div></div>
  )
}

export default Proposal
